
def tonelli(x, tar):
	tar %= x
	if pow(tar, (x-1) // 2, x) != 1:
		return -1
	S, tp, cc, sz = 0, x, x-1, 0
	if tar == 0:
		return 0
	if x % 4 == 3:
		return pow(tar, (x+1) // 4, x)
	while cc % 2 == 0:
		cc //= 2
		S += 1
	Q = cc
	z = 2
	while True:
		if pow(z, (x-1)//2, x) != 1:
			break
		z += 1
	M, c, t, R = S, pow(z, Q, x), pow(tar, Q, x), pow(tar, (Q+1) // 2, x)
	while True:
		if t == 0:
			return 0
		if t == 1:
			return R % x
		sx, tem = 0, t
		while True:
			sx += 1
			tem = (tem * tem) % x
			if tem == 1:
				break
		b = pow(c, 1<<(M-sx-1), x)
		M, c = sx, (b * b) % x
		t, R = (t * c) % x, (R * b) % x

## Step 1 : Find any solution
def gogo(r, d, m):
	if d == 0:
		print(r)
		exit()
		return
	u = tonelli(m, r)
	if u == -1:
		return
	gogo(u, d-1, m)
	gogo((m-u)%m, d-1, m)

